import "../css/Banner.css";

function Banner() {
  return (
    <div className="banner">
      <div className="banner-content">
        <h1><b>Get Latest News</b></h1> 
        <h4>Stay ahead with real-time updates, anytime, anywhere!</h4>
      </div>
    </div>
  );
}

export default Banner;
